branchCategory.description:
&lt;p&gt;
Refrigerated air dryer series IDU, in compliance with the Montreal Protocol Regulations, uses refrigerants R134a and R407C to prevent any damage to the earth&apos;s ozone layer. (Medium size series use R22). Series IDU provides a stable supply of dry air even under high demand conditions with an inlet air temperature of 60&#xb0;C.
&lt;/p&gt;

